import React, { useState } from 'react';
import styled from 'styled-components';
import ChildItemCatalog from './ChildItemCatalog';

const Li = styled.li`
  text-transform: uppercase;
  font-size: 14px;
  line-height: 18px;
`;

const A = styled.a`
  :active,
  :visited,
  :hover,
  :link {
    color: #000000;
  }
`;

const sanphamTest = [
  'sanpham',
  'sanpham',
  'sanpham',
  'sanpham',
  'sanpham',
  'sanpham',
];

const ItemCatalog = ({ catalogs }) => {
  const [showChild, setShowChild] = useState(false);
  const onClick = () => setShowChild(!showChild);

  const items = catalogs.map((item) => (
    <Li key={Math.random()}>
      <A href="/#" onClick={onClick}>
        {item}
      </A>
      {showChild ? <ChildItemCatalog items={sanphamTest} /> : null}
    </Li>
  ));

  return <div>{items}</div>;
};

export default ItemCatalog;
